INSERT INTO `review` (`id`, `good_id`, `user_id`, `rating`, `positive`, `negative`, `comment`, `using_experience`, `date`) VALUES
(1, 53, 1, 5, 'Доволен. Радуют цвета особенно в режиме Game. кнопка на выключение справа поэтому ложась спать просто по панеле провожу рукой он отрубается. приятно, нащупывать ненужно )', 'кнопки в темноте не видны :) но это мелочи нет HDMI', 'Купил в марте 2010. сегодня 15 ноября 2010', 1, '2011-03-04'),
(2, 53, 2, 5, 'Яркие и насыщенные цвета, стильный дизайн,плавные формы, домашний хороший монитор.', 'Сенсорные кнопки, в темноте не видно если нужно нажать, в режиме ожидания светодиод мигает, а не меняет цвет, что раздражает, так как освещает пол комнаты. Нет регулировки наклона, но на моём столе он стоит идеально.', 'Монитор подкупает прежде всего дизайном, похож на ТВ, что для меня важно, так как использую комп как мультимедийный центр. Недостатки не существенны, чтобы не приобрести монитор. Сенсорные кнопки даж больше интересны... Да плюс, чаще нужно будет протирать от пыли, так как глянцевый, но ни сам экран а корпус и ножка.', 3, '2011-03-01'),
(3, 53, 3, 3, 'Хороший дизайн, ножка у меня нормальная. В отличии от предыдущего человека, видимо попадается брак.', 'Диагональ не пропорциональная. Долго пришлось настраивать (долгооооо).', 'Обычная модель. Цвет отображает нормально.Особых минусов и плюсов нет!', 1, '2011-03-07'),
(7, 61, 1, 5, 'дешовый, хорошая цветоподача! 2 года гарантии.', 'когда покупал мне подсунули модель где внутри чтото тарахтело! походу болтик отвалился! после моей 19 дюймовой модели где стороны 4х3 привык несразу!', 'отличьная модэль, свои деньги отработает!!!', 1, '0000-00-00');
